  useEffect(() => {
    fetchMeals();
  }, []);

  const fetchMeals = async () => {
    try {
      const response = await fetch(
        "https://reactmeals-80774-default-rtdb.firebaseio.com/meals.json"
      );

      if (!response.ok) {
        throw new Error();
      }

      const data = await response.json();

      console.log(data);
    } catch (err) {
      console.log("somthing went wrong");
    }
  };

